import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Form,Container, Card,Row,Col , Button } from "react-bootstrap";

function App() {
  return (
    <div className="App">
          <Container>
              <Card>
                <Card.Body>
                <Form>
                <Row>
                <Col sm={11}>
                  <Form.Group controlId="exampleForm.ControlTextarea1">
                    <Form.Control as="textarea" rows="3" placeholder="Enter your messaage"/>
                  </Form.Group>
                </Col>
                <Col sm={1}><Button variant="success">Post</Button></Col>
              </Row>
              </Form>
              </Card.Body>
              </Card>
          </Container>
    </div>
  );
}

export default App;
